import React , { useState }  from 'react'
import { Link } from 'react-router-dom';
import marketplaceimgsrc from "./marketplacelogo.jpg";
import './Navbar.css';
import './App.css';


function Navbar() {

    const [openLinks, setOpenLinks] = useState(false);
    const toggleNavbar = () => {
        setOpenLinks(!openLinks);
      };
    return (
    <div className = "navbar">
        <div className = "leftSide" id={openLinks ? "open" : "close"}>
        <img src={ marketplaceimgsrc} width="40" height="40"></img>&nbsp;&nbsp;&nbsp;
        <label className="navbarLabel"><b>Marketplace</b></label> &nbsp;&nbsp;&nbsp;
            <div className="hiddenLinks">
            <Link to="/addProduct"> <label className="commonTextLabel"><u>Add Product</u></label></Link> 
            </div>
        </div>    
        <div className = "rightSide">
            <Link to="/addProduct"><label className="commonTextLabel"><u><b>Add Product</b></u></label></Link>
            <Link to="/"><label className="commonTextLabel"><u><b>Home</b></u></label></Link> 
 
        </div>    
    </div>
);
}

export default Navbar;
